webpackJsonp([0xb7a21c5a7569],{401:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Recolog",author:"t0m0y4n"}},markdownRemark:{id:"/home/ubuntu/t0m0120/recolog/src/pages/2018-09-20/index.md absPath of file >>> MarkdownRemark",html:'<p>Roppongi.js参加してきたのでメモ\n<a href="https://roppongi-js.connpass.com/event/98983/">https://roppongi-js.connpass.com/event/98983/</a></p>\n<h2>SET活動のすすめ by<a href="https://twitter.com/urahiroshi">@urahiroshi</a></h2>\n<script async class="speakerdeck-embed" data-id="dc6eee68302845f9bdc35cd814cbaadd" data-ratio="1.77777777777778" src="//speakerdeck.com/assets/embed.js"></script>\n<p>遅刻して見れなかった…</p>\n<h2>WebAssemblyのこれまでとこれから by <a href="https://twitter.com/fnwiya">@fnwiya</a></h2>\n<script async class="speakerdeck-embed" data-id="80c6d723cc6f4cee9006701ca71f7bf6" data-ratio="1.33333333333333" src="//speakerdeck.com/assets/embed.js"></script>\n<p><a href="https://speakerdeck.com/urahiroshi/sethuo-dong-falsesusume">https://speakerdeck.com/urahiroshi/sethuo-dong-falsesusume</a></p>\n<p>WebAssemblyはvsJSではなくJSが不得意なところのサポート</p>\n<p>実際に使われているプロジェクト<br>\n<a href="https://www.figma.com/">Figma</a>とか<br>\n数値は早いが文字列遅かったり呼び出し遅かったりするので今後に期待</p>\n<h2>Vue.jsをv0.11.0からv2.5.16にあげようとしている話 by <a href="https://twitter.com/iidaapp">@iidaapp</a></h2>\n<p>闇が深い。<br>\nbowerやgruntをwebpackへ  </p>\n<p>vueのmigrationはこれを使ったらしい<br>\n<a href="https://github.com/vuejs/vue-migration-helper">https://github.com/vuejs/vue-migration-helper</a></p>\n<p>こういうパッケージやら時代の進みで負債になるのどうにかなんないすかね…</p>\n<h2>TypeScript and immutability by <a href="https://twitter.com/brn227">@brn0227</a></h2>\n<script async class="speakerdeck-embed" data-id="e879bc4998574dc0b8cdd9d6d3fe0dcb" data-ratio="1.41436464088398" src="//speakerdeck.com/assets/embed.js"></script>\n<p><a href="https://speakerdeck.com/brn/typescript-and-immutability">https://speakerdeck.com/brn/typescript-and-immutability</a><br>\n外部ライブラリかスプレッド演算子使うしかない<br>\n・参照透過性<br>\n・副作用無し<br>\n・PureComponentでパフォアッブ<br>\n<a href="https://github.com/facebook/immutable-js">Immutable.js</a>はTypeScriptと相性が悪い<br>\n↓<br>\n<a href="https://github.com/mweststrate/immer">immer</a><br>\nPlanObject最高</p>\n<h2>プロトタイプを越えるReact Native by <a href="https://twitter.com/__timakin__">@timakin</a></h2>\n<script async class="speakerdeck-embed" data-id="b052bb7cc6f148b99cd0c9db88ae0722" data-ratio="1.77777777777778" src="//speakerdeck.com/assets/embed.js"></script>\n<p><a href="https://speakerdeck.com/timakin/react-native-beyond-prototype">https://speakerdeck.com/timakin/react-native-beyond-prototype</a></p>\n<p><a href="https://github.com/DylanVann/react-native-fast-image">FastImage</a></p>\n<p>課金ライブラリ<br>\n<a href="https://github.com/dooboolab/react-native-iap">react-native-iap</a></p>\n<h2>JavaScriptはコンパイル言語か by <a href="https://twitter.com/ariaki4dev">@ariaki</a></h2>\n<script async class="speakerdeck-embed" data-id="22f1c345f89449b7aeb81d98b668bee3" data-ratio="1.77777777777778" src="//speakerdeck.com/assets/embed.js"></script>\n<p><a href="https://speakerdeck.com/ariaki/is-javascript-a-compiled-language">https://speakerdeck.com/ariaki/is-javascript-a-compiled-language</a></p>\n<p><a href="https://astexplorer.net/">ASTExploer</a><br>\nJavaScriptをASTに分割。<br>\n<a href="http://int3.github.io/metajs/">metaJS</a><br>\nJavaScriptをASTに分割してステップ実行<br>\n<a href="https://estools.github.io/escodegen/demo/index.html">escodegen</a><br>\nEsprima/escodegenを使ってjsパース/再生成  </p>\n<h2>Universal package.json by <a href="https://twitter.com/L_e_k_o">@れこ</a></h2>\n<p><a href="https://talks.leko.jp/universal-package.json/#0">https://talks.leko.jp/universal-package.json/#0</a></p>\n<p><a href="https://github.com/necolas/react-native-web">react-native-web</a>最近ちょくちょく見るイメージ<br>\nwebpackかMetro Bundlerかどっちかでわかれる  </p>\n<h2>親に向かってなんだそのz-indexは！！ by <a href="https://twitter.com/bug_ojisan">@ojisan</a></h2>\n<script async class="speakerdeck-embed" data-id="e5c905298752499b83cb006b28bd0c11" data-ratio="1.77777777777778" src="//speakerdeck.com/assets/embed.js"></script>\n<p><a href="https://speakerdeck.com/sadnessojisan/qin-nixiang-katutenandasofalsez-indexha">https://speakerdeck.com/sadnessojisan/qin-nixiang-katutenandasofalsez-indexha</a><br>\n<a href="https://developer.mozilla.org/ja/docs/Web/Guide/CSS/Understanding_z_index/The_stacking_context">重ね合わせコンテキスト</a></p>',frontmatter:{title:"",date:null}}},pathContext:{slug:"/2018-09-20/",previous:{id:"/home/ubuntu/t0m0120/recolog/src/pages/2018-03-12/index.md absPath of file >>> MarkdownRemark",excerpt:"serverless/serverless \nLambdaなどのサーバレス環境のデバッグやデプロイをお手軽にするツール   discordへ現在のgithubの草を通知するLambdaFunction t0m0120/github-contribute-checker を t0m…",frontmatter:{title:"serverless framework入門",date:"12 March, 2018"},fields:{slug:"/2018-03-12/"}},next:!1}}}});
